Il buon Amico Giorgio, uomo e padre che ammiro tantissimo, anni fa mi aveva insegnato anche questo. 
Chiedeva ai suoi figli cosa avessero imparato in quella giornata e che lezione ne avevano tratto. 
Lo faceva ogni giorno, e ogni giorno lo spessore dei suoi bambini cresceva.

Mi ero ripromessa che avrei seguito Il suo esempio, facendo anch'io con i miei figli molte di queste cose meravigliose che osservavo da lui.

Custodisco nel cuore questi doni che ho ricevuto, come tesori ricchi e preziosi.

So gi√† che questa sera mi dirai che hai imparato a far volare un aquilone.
E Io da questo, cosa ho imparato invece?

Sarebbe presuntuoso da parte mia pensare di aver imparato qualcosa, ma sicuramente ho osservato.
Osservato che quando cala il vento e non √® cos√¨ semplice rimanere in alto, ci vuole tanta tenacia, tanta energia e tanto desiderio per tornare su'.
Ho anche osservato che ci vuole l'umilta' di accettare di non essere stata in grado di stare in alto, nel vento.
Ma questa consapevolezza forse ti da modo di tornare piu' forte di prima.
Studiare il vento, spostarti e volare ancora!
Si, volare ancora.

A modo mio ‚ù§Ô∏è quello che amo. 
